class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        if len(s) == 0:
            return True
        idx_s = 0
        for c in t:
            if idx_s < len(s) and c == s[idx_s]:
                idx_s += 1
        return len(s) == idx_s

def solve_string(solution, s, t, expected):
        return "%10s %10s %8s %8s" % (s, t, expected, solution.isSubsequence(s,t))

s = Solution()
print("%10s %10s %8s %8s" % ("s", "t", "Expected", "Result"))
print(solve_string(s,"ace","abcde","True"))
print(solve_string(s,"aec","abcde","False"))
print(solve_string(s,"","ahbgdc","True"))
print(solve_string(s,"abc","ahbgdc","True"))
print(solve_string(s,"axc","ahbgdc","False"))
print(solve_string(s,"leeeeetcode","","True"))
